// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract LiquidationProtocol is 
    Initializable, 
    AccessControlUpgradeable, 
    PausableUpgradeable, 
    ReentrancyGuardUpgradeable 
{
    // Roles
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");
    bytes32 public constant KEEPER_ROLE = keccak256("KEEPER_ROLE");
    bytes32 public constant TREASURY_ROLE = keccak256("TREASURY_ROLE");

    // Protocol Configuration
    struct ProtocolConfig {
        uint256 liquidationThreshold;
        uint256 maxLoanToValue;
        uint256 baseBorrowRate;
        uint256 liquidationPenalty;
    }

    // Loan Structure
    struct Loan {
        address borrower;
        address collateralToken;
        address priceFeed;
        uint256 collateralAmount;
        uint256 borrowedAmount;
        uint256 interestRate;
        uint256 startTimestamp;
        bool isActive;
    }

    // Auction Structure
    struct Auction {
        address collateralToken;
        uint256 collateralAmount;
        uint256 startPrice;
        uint256 minimumPrice;
        uint256 startTimestamp;
        bool isActive;
    }

    // State Variables
    mapping(uint256 => Loan) public loans;
    mapping(uint256 => Auction) public auctions;
    mapping(address => mapping(address => uint256)) public userCollateral;

    IERC20 public stablecoin;
    IERC20 public protocolToken;

    ProtocolConfig public config;
    uint256 public nextLoanId;
    uint256 public nextAuctionId;

    // Events
    event LoanCreated(
        uint256 indexed loanId, 
        address indexed borrower, 
        address collateralToken, 
        uint256 collateralAmount, 
        uint256 borrowedAmount
    );
    event LoanLiquidated(
        uint256 indexed loanId, 
        address indexed liquidator, 
        uint256 collateralLiquidated
    );
    event AuctionStarted(
        uint256 indexed auctionId, 
        address collateralToken, 
        uint256 collateralAmount
    );
    event CollateralPurchased(
        uint256 indexed auctionId, 
        address indexed buyer, 
        uint256 collateralAmount
    );

    // Initializer (replaces constructor for upgradeable contracts)
    function initialize(
        address _stablecoin, 
        address _protocolToken,
        address _admin
    ) public initializer {
        // Initialize inherited contracts
        __AccessControl_init();
        __Pausable_init();
        __ReentrancyGuard_init();

        _grantRole(DEFAULT_ADMIN_ROLE, _admin);
        _grantRole(keccak256("ADMIN_ROLE"), _admin);

        // Set core tokens
        stablecoin = IERC20(_stablecoin);
        protocolToken = IERC20(_protocolToken);

        // Set default protocol configuration
        config = ProtocolConfig({
            liquidationThreshold: 80, // 80%
            maxLoanToValue: 70, // 70%
            baseBorrowRate: 5_00, // 5%
            liquidationPenalty: 10_00 // 10%
        });
    }

    // Borrow function with comprehensive checks
    function borrow(
        address collateralToken, 
        address priceFeed,
        uint256 collateralAmount, 
        uint256 borrowAmount
    ) external whenNotPaused nonReentrant {
        // Validate inputs
        require(collateralAmount > 0, "Invalid collateral amount");
        require(borrowAmount > 0, "Invalid borrow amount");
        require(priceFeed != address(0), "Invalid price feed");

        // Transfer collateral from borrower
        IERC20(collateralToken).transferFrom(
            msg.sender, 
            address(this), 
            collateralAmount
        );

        // Validate collateralization
        uint256 collateralValue = _getCollateralValue(
            collateralToken, 
            priceFeed, 
            collateralAmount
        );
        uint256 maxBorrowable = (collateralValue * config.maxLoanToValue) / 100;

        require(
            borrowAmount <= maxBorrowable, 
            "Borrow amount exceeds collateral value"
        );

        // Create loan
        uint256 loanId = nextLoanId++;
        loans[loanId] = Loan({
            borrower: msg.sender,
            collateralToken: collateralToken,
            priceFeed: priceFeed,
            collateralAmount: collateralAmount,
            borrowedAmount: borrowAmount,
            interestRate: config.baseBorrowRate,
            startTimestamp: block.timestamp,
            isActive: true
        });

        // Transfer stablecoins
        stablecoin.transfer(msg.sender, borrowAmount);

        // Emit event
        emit LoanCreated(
            loanId, 
            msg.sender, 
            collateralToken, 
            collateralAmount, 
            borrowAmount
        );
    }

    // Liquidation function
    function liquidate(uint256 loanId) external whenNotPaused nonReentrant {
        Loan storage loan = loans[loanId];
        require(loan.isActive, "Loan not active");

        // Check if loan is liquidatable
        bool isLiquidatable = _checkLiquidation(loan);
        require(isLiquidatable, "Loan not liquidatable");

        // Start Dutch auction
        uint256 auctionId = _startLiquidationAuction(loan);

        // Mark loan as inactive
        loan.isActive = false;

        emit LoanLiquidated(loanId, msg.sender, loan.collateralAmount);
    }

    // Internal liquidation auction starter
    function _startLiquidationAuction(
        Loan memory loan
    ) internal returns (uint256) {
        uint256 collateralPrice = _getCollateralValue(
            loan.collateralToken, 
            loan.priceFeed, 
            loan.collateralAmount
        );

        uint256 auctionId = nextAuctionId++;
        auctions[auctionId] = Auction({
            collateralToken: loan.collateralToken,
            collateralAmount: loan.collateralAmount,
            startPrice: collateralPrice,
            minimumPrice: (collateralPrice * (100 - config.liquidationPenalty)) / 100,
            startTimestamp: block.timestamp,
            isActive: true
        });

        emit AuctionStarted(
            auctionId, 
            loan.collateralToken, 
            loan.collateralAmount
        );

        return auctionId;
    }

    // Auction purchase function
    function purchaseCollateral(uint256 auctionId) external nonReentrant {
        Auction storage auction = auctions[auctionId];
        require(auction.isActive, "Auction not active");

        // Calculate current auction price
        uint256 currentPrice = _calculateCurrentAuctionPrice(auction);
        uint256 totalPurchaseValue = currentPrice * auction.collateralAmount;

        // Transfer stablecoins from buyer
        stablecoin.transferFrom(msg.sender, address(this), totalPurchaseValue);

        // Transfer collateral to buyer
        IERC20(auction.collateralToken).transfer(
            msg.sender, 
            auction.collateralAmount
        );

        // Close auction
        auction.isActive = false;

        emit CollateralPurchased(
            auctionId, 
            msg.sender, 
            auction.collateralAmount
        );
    }

    // Internal price calculation for Dutch auction
    function _calculateCurrentAuctionPrice(
        Auction memory auction
    ) internal view returns (uint256) {
        uint256 timeElapsed = block.timestamp - auction.startTimestamp;

        // Price reduction over 24 hours
        uint256 priceReduction = (auction.startPrice - auction.minimumPrice) 
            * timeElapsed 
            / (24 hours);

        return auction.startPrice - priceReduction;
    }

    // Internal function to get collateral value using Chainlink
    function _getCollateralValue(
        address collateralToken, 
        address priceFeed,
        uint256 amount
    ) internal view returns (uint256) {
        AggregatorV3Interface chainlinkFeed = AggregatorV3Interface(priceFeed);

        // Get latest price
        (
            /* uint80 roundID */,
            int price,
            /* uint startedAt */,
            /* uint timeStamp */,
            /* uint80 answeredInRound */
        ) = chainlinkFeed.latestRoundData();

        // Convert price to USD value
        return uint256(price) * amount / (10 ** chainlinkFeed.decimals());
    }

    // Internal liquidation check
    function _checkLiquidation(Loan memory loan) internal view returns (bool) {
        uint256 collateralValue = _getCollateralValue(
            loan.collateralToken, 
            loan.priceFeed, 
            loan.collateralAmount
        );

        uint256 borrowedValue = loan.borrowedAmount;

        // Check if collateral falls below liquidation threshold
        return collateralValue < (borrowedValue * config.liquidationThreshold) / 100;
    }

    // Admin functions for protocol configuration
    function updateProtocolConfig(
        uint256 _liquidationThreshold,
        uint256 _maxLoanToValue,
        uint256 _baseBorrowRate,
        uint256 _liquidationPenalty
    ) external onlyRole(ADMIN_ROLE) {
        config.liquidationThreshold = _liquidationThreshold;
        config.maxLoanToValue = _maxLoanToValue;
        config.baseBorrowRate = _baseBorrowRate;
        config.liquidationPenalty = _liquidationPenalty;
    }

    // Emergency pause mechanism
    function pause() external onlyRole(ADMIN_ROLE) {
        _pause();
    }

    function unpause() external onlyRole(ADMIN_ROLE) {
        _unpause();
    }
}

